mapper.select:

select 

from skf.skf3010_m_shataku_parking_block
where shataku_kanri_no = #{shatakuKanriNo,jdbcType=NUMERIC}
  and parking_kanri_no = #{parkingKanriNo,jdbcType=NUMERIC}

mapper.delete:

delete from skf.skf3010_m_shataku_parking_block
where shataku_kanri_no = #{shatakuKanriNo,jdbcType=NUMERIC}
  and parking_kanri_no = #{parkingKanriNo,jdbcType=NUMERIC}
